$_MODULE['<{facebookproductad}prestashop>pixel-settings_c771668e2cf9c1c8d7ca4fd52cb0ca02'] = 'To get a more accurate estimate of the number of conversions on your shop attributed to your Facebook ads and reach more people on the social network, you can activate the "Advanced matching" option below. This feature allows the pixel to send customer information, in an encrypted and secure manner, along with the detected events. Read';
