$_MODULE['<{facebookproductad}prestashop>pixel-settings_c155acbd3dc5d33912a67652458fffe1'] = 'The test event code is a temporary code provided by Facebook when you set up test events in Events Manager. It helps you verify that your server events are being received correctly by Facebook without affecting your actual data. Use this code during implementation and testing phases only, and remove it before going to production.';
$_MODULE['<{facebookproductad}prestashop>pixel-settings_e7d6e86a6c8931e735f550133a9ece48'] = 'Learn more about test event codes';
$_MODULE['<{facebookproductad}prestashop>pixel-settings_4e9f2be9ef28b6b9791fefbf08991c26'] = 'If you get the "Server Sending Invalid Match Key Parameters" warning in your Business Manager, this is due to the use by some of your customers of a cookie blocker like "adblock". Some data (IP, state, country, etc...) are then incorrectly formatted according to Facebook guidelines. These are only warnings and can be ignored. But if you don\\\'t want to see these warnings anymore, you can suppress the sending of the problematic data by activating the following option. Read';
$_MODULE['<{facebookproductad}prestashop>pixel-settings_f4dab457e0e5e2e64fac65d6ddcdd5fe'] = 'No longer see warnings due to cookie blockers:';
$_MODULE['<{facebookproductad}prestashop>pixel-settings_b12cffc00a271871b21c6f277fa6b226'] = 'The options below allow you to accurately manage the conversion value that will be sent to Facebook when an order is placed. By default, the conversion value sent to Facebook includes taxes, shipping and wrapping fees. But, you may not want to include one or more of these values... In this case, select "No" for the corresponding options below:';
$_MODULE['<{facebookproductad}prestashop>pixel-settings_bb0ec1794802805e848e0a5f80572092'] = 'Include taxes in conversion value';
