$_MODULE['<{facebookproductad}prestashop>pixel-settings_be8e1d0042c2db6aa683a39ecc129ebc'] = 'If you don\\\'t see the "add to wishlist" or "initiate checkout" events in your Facebook Business Manager account after a few hours when you should, it may be because your theme has changed the default HTML elements related to these events. In this case, ask your technical contact to replace the default HTML elements below with your theme\\\'s custom elements so that tracking can work.';
$_MODULE['<{facebookproductad}prestashop>pixel-settings_cb96bb05645d375aea180aee2d65c58f'] = 'By default, the module triggers the "add to cart" event only when the "add to cart" button is clicked. But if you also want to trigger the "add to cart" event when the cart page is displayed, set this option to "YES".';
$_MODULE['<{facebookproductad}prestashop>pixel-settings_d0dd3f5da593c3a2a0c68d9a5cf87c09'] = 'Also trigger the "add to cart" event when the cart page loads:';
